SELECT ?person WHERE {
    ?person dbo:birthDate "1983-12-20"^^xsd:date .
    { ?person dbo:abstract ?abstract . FILTER (regex(?abstract, "sports manager", "i")) }
    UNION
    { ?person dbo:abstract ?abstract . FILTER (regex(?abstract, "soccer manager", "i")) }
    UNION
    { ?person dbo:abstract ?abstract . FILTER (regex(?abstract, "soccer player", "i")) }
}
```

